import React, { Component } from "react";
import { connect } from "react-redux";



class TripsDetails extends Component {


  render(){
    return (
      <div>
        <h1>details</h1>
        <button>Cadastrar Trip</button>
        <button>Aprovar</button>



      </div>
    );
  }
}
export default connect(null, null)(TripsDetails);
